nt: 2em;box-sizing: border-box !important;word-wrap: break-word !important;\"><span style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;color: rgb(2, 30, 170);\"><strong style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;\"><span style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;font-size: 15px;\">路人又开始指指点点：</span></strong></span><span style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;color: rgb(255, 0, 0);\"><strong style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;\"><span style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;font-size: 15px;\">像什么样子？这男人太不像话，居然让女人牵驴，大男子主义。</span></strong></span></p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;line-height: 28.4444px;text-indent: 2em;box-sizing: border-box !important;word-wrap: break-word !important;\"><strong style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;\"><span style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;font-size: 15px;\">这下夫又脸红了，他们决定夫妻一起骑驴。</span></strong></p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;line-height: 28.4444px;box-sizing: border-box !important;word-wrap: break-word !important;\"><br style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;\"/></p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: