('23','56','0','饲料微商平台新闻发布会','新闻部','饲料微商新闻发布会','images/3/2016/01/gLqbOP8PPkGf8mQ7u55MPB7BPM9uGp.jpg','<p><img src=\"http://market.hasxmy.com/attachment/images/3/2016/01/sM1lJ162Kz21414Hlz1J1ZdZd6L46k.gif\" width=\"100%\" alt=\"3a57ef71926bbc2b7fcc5b7b834678ce.gif\"/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; line-height: 25.6px; white-space: normal; text-indent: 28px; text-align: justify;\"><span style=\"margin: 0px; padding: 0px; font-family: 宋体; font-size: 14px;\">2016<span style=\"margin: 0px; padding: 0px;\">年</span><span style=\"margin: 0px; padding: 0px; font-family: Calibri;\">1</span></span><span style=\"margin: 0px; padding: 0px; font-family: Calibri; font-size: 14px;\">月</span><span style=\"margin: 0px; padding: 0px; font-family: 宋体; font-size: 14px;\">26</span><span style=\"margin: 0px; padding: 0px; font-family: Calibri; font-size: 14px;\">日，</span><span style=\"margin: 0px; padding: 0px; font-family: 宋体; font-size: 14px;\">由河南三星牧业科技有限公司主办，在中国饲料信息网、河南畜牧信息网、河南日报农村版、河南畜牧兽医杂志社、河南电视台新农村频道、河南电台农村广播等</span><span style=\"margin: 0px; padding: 0px; font-family: 宋体; font-size: 14px;\">10<span style=\"margin: 0px; padding: 0px;\">余家新闻媒体单位的共同支持下，河南三星牧业电子商务平台新闻发布会</span></span><span style=\"margin: 0px; padding: 0px; font-family: 宋体; font-size: 14px;\">在郑州黄河迎宾馆</span><span style=\"margin: 0px; padding: 0px; font-family: 宋体; font-size: 14px;\">顺利召开。</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; line-height: 25.6px; white-space: normal; text-indent: 28px; text-align: justify;\"><span style=\"margin: 0px; padding: 0px; font-family: 宋体; font-size: 14px;\">发布会首先由</span><span style=\"margin: 0px; padding: 0px; font-family: Calibri; font-size: 14px;\">公司</span><span style=\"margin: 0px; padding: 0px; font-family: 宋体; font-size: 14px;\">总经理王丰收向各位与会嘉宾通报了公司开展电子商务平台“饲料微商”工作的背景和目的。王总说：</span><span style=\"margin: 0px; padding: 0px; font-family: 宋体;\">我国饲料工业经过近四十年的发展，已初步形成饲料加工业、饲料原料工业、饲料添加剂工业、饲料机械工业、饲料科研教育等为支撑的饲料工业体系，在推动现代养殖业发展方面起到重要作用。在电子商务背景下，饲料工业的发展面临新的挑战和机遇，李克强</span><span style=\"margin: 0px; padding: 0px; font-family: 宋体;\">总理</span><span style=\"margin: 0px; padding: 0px; font-family: 宋体;\">在政府工作报告中提出，“制定‘互联网+’行动计划，推动移动互联网、云计算、大数据、物联网等与现代制造业结合，促进电子商务、工业互联网和互联网金融健康发展，引导互联网企业拓展国际市场。”</span><span style=\"margin: 0px; padding: 0px; font-family: 宋体;\">为此，河南三星牧业科技有限公司及时抓住发展</span><span style=\"margin: 0px; padding: 0px; font-family: 宋体;\">机遇，</span><span style=\"margin: 0px; padding: 0px; font-family: 宋体;\">在不断发展的前提下，</span><span style=\"margin: 0px; padding: 0px; font-family: 宋体; font-size: 14px;\">&nbsp;在互联网高速发展的时代，借助网络手段，实现传统的饲料行业顺应发展之势，搭乘网络快车，打造诚信、实用、便捷的电子商务平台。来更好地服务广大养殖户，</span><span style=\"margin: 0px; padding: 0px; font-family: 宋体;\">在新时期下</span><span style=\"margin: 0px; padding: 0px; font-family: 宋体;\">引领</span><span style=\"margin: 0px; padding: 0px; font-family: 宋体;\">饲料行业进入互联网</span><span style=\"margin: 0px; padding: 0px; font-family: 宋体;\">+时代，从而更好地</span><span style=\"margin: 0px; padding: 0px; font-family: 宋体;\">推动我国饲料工业的可持续发展。</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; line-height: 25.6px; white-space: normal; text-indent: 28px; text-align: justify;\"><span style=\"margin: 0px; padding: 0px; font-family: 宋体; font-size: 14px;\">接着王丰收总经理又从平台运营原则、运营情况、发展目标等几个方面向各位嘉宾简单介绍了“饲料微商”电子商务平台的情况。</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; line-height: 25.6px; white-space: normal; text-indent: 28px; text-align: justify;\"><span style=\"margin: 0px; padding: 0px; font-family: 宋体; font-size: 14px;\">一、</span><span style=\"margin: 0px; padding: 0px; font-family: 宋体; font-size: 14px;\">平台的运营的基本原则</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; line-height: 25.6px; white-space: normal; text-align: justify;\"><span style=\"margin: 0px; padding: 0px; font-family: 宋体; font-size: 14px;\">&nbsp; &nbsp;在公司“&nbsp;饲料微商”电子商务平台建设和运行过程中，我们秉承产品质量、公司诚信第一，简化饲料供应流程，拒绝传统销售中间环节，切实还利养殖户，服务养殖户基本发展原则。并在公司<span style=\"margin: 0px; padding: 0px; font-family: Calibri;\">2015</span><span style=\"margin: 0px; padding: 0px;\">年</span><span style=\"margin: 0px; padding: 0px; font-family: Calibri;\">3</span><span style=\"margin: 0px; padding: 0px;\">月</span><span style=\"margin: 0px; padding: 0px; font-family: Calibri;\">15</span><span style=\"margin: 0px; padding: 0px;\">日的启动会议上，参于项目建设的各部门会议上一直通过了：“饲料微商”电子商务平台，始终坚持“</span><span style=\"margin: 0px; padding: 0px; font-family: Calibri;\">B2C</span><span style=\"margin: 0px; padding: 0px;\">”（厂家直接到用户）运营模式，拒绝中间商，还利养殖户”的重要决议。平台运行伊始，平台先后通过“微信官方”、“支付宝官方”等公共支付系统的认证，彻底解决货款安全问题，目前正在和国家四大银行协调开通银联支付系统，拓宽用户的安全支付渠道。平台运行过程中，我们坚持“线上”购买全国统一成本价格销售，并向用户承诺，因产品质量问题，公司无条件退款。同时我们开通技术、售后服务措施，通过电话、</span><span style=\"margin: 0px; padding: 0px; font-family: Calibri;\">qq</span><span style=\"margin: 0px; padding: 0px;\">、微信等方式及时解决用户购买过程中出现的各种障碍。为了使平台得到更好的推广，让更多养殖户朋友体验互联网时代的优势，公司在成本内再投入设置推广基金，定期推出的各种让利活动，持续对推广者的提供推广佣金提成，让所有用户在消费中享受更多的实惠，在推广中获取更大的快乐。</span></span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; line-height: 25.6px; white-space: normal; text-indent: 28px; text-align: justify;\"><span style=\"margin: 0px; padding: 0px; font-family: 宋体; font-size: 14px;\">二、平台运营现状</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; line-height: 25.6px; white-space: normal; text-indent: 28px; text-align: justify;\"><span style=\"margin: 0px; padding: 0px; font-family: 宋体; font-size: 14px;\">经过持续筹备和建设，公司“饲料微商”电子商务平台于2016年<span style=\"margin: 0px; padding: 0px; font-family: Calibri;\">1</span><span style=\"margin: 0px; padding: 0px;\">月</span><span style=\"margin: 0px; padding: 0px; font-family: Calibri;\">11</span><span style=\"margin: 0px; padding: 0px;\">日上线试运行以来，在短短半个月时间内，关注量急剧攀升，止于今天，点击量</span><span style=\"margin: 0px; padding: 0px; font-family: Calibri;\">6806</span><span style=\"margin: 0px; padding: 0px;\">，关注量已达到</span><span style=\"margin: 0px; padding: 0px; font-family: Calibri;\">836</span><span style=\"margin: 0px; padding: 0px;\">个微信号，粉丝数量</span><span style=\"margin: 0px; padding: 0px; font-family: Calibri;\">1986</span><span style=\"margin: 0px; padding: 0px;\">位，订单数量</span><span style=\"margin: 0px; padding: 0px; font-family: Calibri;\">1658</span><span style=\"margin: 0px; padding: 0px;\">个，实际交易数量</span><span style=\"margin: 0px; padding: 0px; font-family: Calibri;\">682</span><span style=\"margin: 0px; padding: 0px;\">笔。发展速度远远超过预期。业务过程累计销售教槽产品</span><span style=\"margin: 0px; padding: 0px; font-family: Calibri;\">312</span><span style=\"margin: 0px; padding: 0px;\">吨、其他产品</span><span style=\"margin: 0px; padding: 0px; font-family: Calibri;\">518</span><span style=\"margin: 0px; padding: 0px;\">吨，促销商品</span><span style=\"margin: 0px; padding: 0px; font-family: Calibri;\">988</span><span style=\"margin: 0px; padding: 0px;\">件。受理平台操作咨询和服务</span><span style=\"margin: 0px; padding: 0px; font-family: Calibri;\">65</span><span style=\"margin: 0px; padding: 0px;\">件，成功处理</span><span style=\"margin: 0px; padding: 0px; font-family: Calibri;\">65</span><span style=\"margin: 0px; padding: 0px;\">件，售后服务咨询和问题</span><span style=\"margin: 0px; padding: 0px; font-family: Calibri;\">32</span><span style=\"margin: 0px; padding: 0px;\">件，成功处理</span><span style=\"margin: 0px; padding: 0px; font-family: Calibri;\">32</span><span style=\"margin: 0px; padding: 0px;\">件。接受操作失误退款申请</span><span style=\"margin: 0px; padding: 0px; font-family: Calibri;\">2</span><span style=\"margin: 0px; padding: 0px;\">起，退还金额</span><span style=\"margin: 0px; padding: 0px; font-family: Calibri;\">6000</span><span style=\"margin: 0px; padding: 0px;\">元，电话回访客户满意度调查，满意率</span><span style=\"margin: 0px; padding: 0px; font-family: Calibri;\">98%</span><span style=\"margin: 0px; padding: 0px;\">。</span></span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; line-height: 25.6px; white-space: normal; text-indent: 28px; text-align: justify;\"><span style=\"margin: 0px; padding: 0px; font-family: 宋体; font-size: 14px;\">三、</span><span style=\"margin: 0px; padding: 0px; font-family: 宋体; font-size: 14px;\">平台发展目标展望</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; line-height: 25.6px; white-space: normal; text-indent: 28px; text-align: justify;\"><span style=\"margin: 0px; padding: 0px; font-family: 宋体; font-size: 14px;\">在运行过程中，我们真正体会到了在互联网时代，公司“饲料微商”电子商务平台为广大养殖户带来的便利和实惠，为企业先进技术和产品推广提供了实用便捷的方式，再次坚定我们打造中国第一饲料电子商务平台的信念。我们将在现有的基础上，在平台建设方面继续优化服务模块，拓宽服务功能，继续保证平台运营的安全性。公司也会继续加大对电子商务平台的投入，本年度继续开展“零利润，成本内再投入”的运营模式，坚持“拒绝中间商、还利养殖户”的发展原则。并在今后逐渐完善：平台的“专属物流运输系统、养殖技术远程服务体系、实体店体验和售后服务网点等和平台相关的各项工作。我们预计，在公司的不断努力下，在社会各界的不断支持和关注下，公司“饲料微商”电子商务平台借乘互联网时代东风，<span style=\"margin: 0px; padding: 0px; font-family: Calibri;\">2016</span><span style=\"margin: 0px; padding: 0px;\">年度一定能实现关注量过万，粉丝量过十万的发展速度，线上销售商品高达</span><span style=\"margin: 0px; padding: 0px; font-family: Calibri;\">6</span><span style=\"margin: 0px; padding: 0px;\">万吨，交易金额</span><span style=\"margin: 0px; padding: 0px; font-family: Calibri;\">3</span><span style=\"margin: 0px; padding: 0px;\">亿元。我们相信，在公司全体员工的共同努力下，在互联网高速发展时代“河南三星牧业科技有限公司”必将成为行业电子商务方面的一匹黑马，“饲料微商”电子电子商务平台也必将成为中国第一电子商务平台。</span></span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; line-height: 25.6px; white-space: normal; text-indent: 28px; text-align: justify;\"><span style=\"margin: 0px; padding: 0px; font-family: 宋体; font-size: 14px;\">王总最后郑重地说：“我是王丰收，我为饲料微商代言”，再次感谢大家对公司“饲料微商”电子商务平台的关注和支持，并诚挚邀请您为“饲料微商”代言，发布会在一片激情的掌声中顺利闭幕。</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; line-height: 25.6px; white-space: normal; text-indent: 28px;\"><span style=\"margin: 0px; padding: 0px; font-family: 宋体; font-size: 14px; font-weight: bold; line-height: 1.6;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;文章来源：三星牧业大数据营销中心新闻部</span></p><p><br/></p>','http://mp.weixin.qq.com/s?__biz=MjM5MjMzMjM0Ng==&mid=401378654&idx=2&sn=be734cc68ec5c54f9381c0a29299d494#rd','98','0','1456737180'),
('11','39','0','两个和尚在被窝里的对话（深度好文）','','在这个世界上，我们都生活在“棉被”里，别人就是我们的棉被，当我们用心去暧棉被的时候，棉被也会给我们温暖。','images/3/2016/01/mUuVUaaU11uuelR1li1kWiU1uwN2NL.jpg','<h2 class=\"rich_media_title\" id=\"activity-name\" style=\"margin: 0px 0px 14px;padding: 0px 0px 10px;font-weight: 400;font-size: 24px;line-height: 1.4;border-bottom-width: 1px;border-bottom-style: solid;border-bottom-color: rgb(231, 231, 235);\">两个和尚在被窝里的对话（深度好文）</h2><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;box-sizing: border-box !important;word-wrap: break-word !important;\"><span style=\"margin: 0px;padding: 0px 0px 0px 2px;max-width: 100%;box-sizing: border-box;word-wrap: break-word !important;border-width: 0px;color: rgb(127, 127, 127);\"><br style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;\"/></span></p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;box-sizing: border-box !important;word-wrap: break-word !important;\"><img data-src=\"http://mmbiz.qpic.cn/mmbiz/XibOUa51BPalL9y0LKOU8lD5TG2bDRGrMcXl9f8yjEOoME31zEvsmmHHtFtvU0qdRibAHkU6luX18CEBkYib4uKeA/0?wxfrom=5\" data-type=\"jpeg\" data-w=\"\" data-ratio=\"0.6944444444444444\" data-s=\"300,640\" width=\"auto\" _width=\"auto\" src=\"http://mmbiz.qpic.cn/mmbiz/XibOUa51BPalL9y0LKOU8lD5TG2bDRGrMcXl9f8yjEOoME31zEvsmmHHtFtvU0qdRibAHkU6luX18CEBkYib4uKeA/640?wxfrom=5&tp=webp&wx_lazy=1\" style=\"margin: 0px;padding: 0px;height: auto !important;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;width: auto !important;visibility: visible !important;\"/></p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;box-sizing: border-box !important;word-wrap: break-word !important;\"><span style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;color: rgb(0, 112, 192);\"><br style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;\"/></span></p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;box-sizing: border-box !important;word-wrap: break-word !important;\"><span style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;color: rgb(0, 112, 192);\">来源：凤凰网</span></p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;box-sizing: border-box !important;word-wrap: break-word !important;\"><span style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;color: rgb(127, 127, 127);\"><strong style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;\"><span style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;font-size: 14px;\"><br style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;\"/></span></strong></span></p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;box-sizing: border-box !important;word-wrap: break-word !important;\"><span style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;color: rgb(31, 73, 125);\">在一座破旧的庙宇里，一个小和尚沮丧的对老和尚说：“我们这一个小庙，只有我们两个和尚，我下山去化缘的时候人家都是对我恶语相向，经常说我是野和尚，给我们的香火钱更是少得可怜。</span></p><p style=\"margin-top: 20px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;box-sizing: border-box !important;word-wrap: break-word !important;\"><img data-src=\"http://mmbiz.qpic.cn/mmbiz/XibOUa51BPalL9y0LKOU8lD5TG2bDRGrMMnUElCeTSEEIFdGcHnzm2SaQxkCuQLHASxoZed5JiaeiaKWcAxtCy2qQ/0?wxfrom=5\" data-type=\"jpeg\" data-w=\"467\" data-ratio=\"0.7301927194860813\" data-s=\"300,640\" width=\"auto\" _width=\"auto\" src=\"http://mmbiz.qpic.cn/mmbiz/XibOUa51BPalL9y0LKOU8lD5TG2bDRGrMMnUElCeTSEEIFdGcHnzm2SaQxkCuQLHASxoZed5JiaeiaKWcAxtCy2qQ/640?wxfrom=5&tp=webp&wx_lazy=1\" style=\"margin: 0px;padding: 0px;height: auto !important;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;width: auto !important;visibility: visible !important;\"/><br style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;\"/></p><p style=\"margin-top: 20px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;box-sizing: border-box !important;word-wrap: break-word !important;\"><span style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;color: rgb(31, 73, 125);\">今天去化缘，这么冷的天都没有人给我开门，化到的斋饭也少得可怜。师父，我们菩提寺要想成为你所说的庙宇千间、钟声不绝的大寺，恐怕是不可能了。”老和尚披着袈裟什么话也没有说，只是闭着眼睛静静地听着。</span></p><p style=\"margin-top: 20px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;box-sizing: border-box !important;word-wrap: break-word !important;\"><img data-src=\"http://mmbiz.qpic.cn/mmbiz/XibOUa51BPalL9y0LKOU8lD5TG2bDRGrMFrHibJFoXcgCYTHQPk47icxapgFYIOPClMrVGWozH7QAtwhAiaibiaZAibmw/0?wxfrom=5\" data-type=\"jpeg\" data-w=\"466\" data-ratio=\"0.7381974248927039\" data-s=\"300,640\" width=\"auto\" _width=\"auto\" src=\"http://mmbiz.qpic.cn/mmbiz/XibOUa51BPalL9y0LKOU8lD5TG2bDRGrMFrHibJFoXcgCYTHQPk47icxapgFYIOPClMrVGWozH7QAtwhAiaibiaZAibmw/640?wxfrom=5&tp=webp&wx_lazy=1\" style=\"margin: 0px;padding: 0px;height: auto !important;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;width: auto !important;visibility: visible !important;\"/><br style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;\"/></p><p style=\"margin-top: 20px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;box-sizing: border-box !important;word-wrap: break-word !important;\"><span style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;color: rgb(31, 73, 125);\">小和尚絮絮叨叨地说着，最后老和尚沉默一阵，终于睁开眼睛问道：“这北风吹得紧，外边又冰天雪地的，你冷不冷啊？”小和尚浑身哆嗦着说道：“我冷呀，双脚都冻麻了。”老和尚说道：“那不如我们早些睡觉吧！”</span></p><p style=\"margin-top: 20px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;box-sizing: border-box !important;word-wrap: break-word !important;\"><img data-src=\"http://mmbiz.qpic.cn/mmbiz/XibOUa51BPalL9y0LKOU8lD5TG2bDRGrMZ5xAC1DQNG4LHI2Iw4VY2eA4LrDoUys2FjTeIScAt7Vfce43WWwk8g/0?wxfrom=5\" data-type=\"jpeg\" data-w=\"474\" data-ratio=\"0.7236286919831224\" data-s=\"300,640\" width=\"auto\" _width=\"auto\" src=\"http://mmbiz.qpic.cn/mmbiz/XibOUa51BPalL9y0LKOU8lD5TG2bDRGrMZ5xAC1DQNG4LHI2Iw4VY2eA4LrDoUys2FjTeIScAt7Vfce43WWwk8g/640?wxfrom=5&tp=webp&wx_lazy=1\" style=\"margin: 0px;padding: 0px;height: auto !important;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;width: auto !important;visibility: visible !important;\"/><br style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;\"/></p><p style=\"margin-top: 20px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;box-sizing: border-box !important;word-wrap: break-word !important;\"><span style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;color: rgb(31, 73, 125);\">老和尚和小和尚熄灭了灯钻进了被窝，过了一个多小时，老和尚问道：“现在你暖和了吗？”小和尚说道：“当然暖和了，就像睡在阳光下一样。”</span></p><p style=\"margin-top: 20px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;box-sizing: border-box !important;word-wrap: break-word !important;\"><br style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;\"/></p><p style=\"margin-top: 20px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;box-sizing: border-box !important;word-wrap: break-word !important;\"><span style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;color: rgb(31, 73, 125);\">老和尚说道：“棉被放在床上一直冰凉的，可是人一躺进去就变得暖和了，你说是棉被把人暖和了，还是人把棉被暖和了？”小和尚一听，笑了：“师傅你真糊涂啊，棉被怎么可能把人暖和了，当然是人把棉被暖和了。”</span></p><p style=\"margin-top: 20px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;box-sizing: border-box !important;word-wrap: break-word !important;\"><br style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;\"/></p><p style=\"margin-top: 20px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;box-sizing: border-box !important;word-wrap: break-word !important;\"><span style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;color: rgb(31, 73, 125);\">老和尚说道：“既然棉被给不了我们温暖，反而要靠我们去暖和它，那么我们还盖着棉被做什么？”小和尚想了想说道：“虽然棉被给不了我们温暖，可是厚厚的棉被却可以保存我们的温暖，让我们在被窝里睡得舒服啊！”</span></p><p style=\"margin-top: 20px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;box-sizing: border-box !important;word-wrap: break-word !important;\"><br/></p><p style=\"margin-top: 20px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;box-sizing: border-box !important;word-wrap: break-word !important;\"><span style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;color: rgb(31, 73, 125);\">黑暗中，老僧会心一笑：“我们撞钟诵经的僧人何尝不是躺在厚厚棉被下的人，而那些芸芸众生又何尝不是我们厚厚的棉被呢！只要我们一心向善，那么冰冷的棉被终究会被我们暖热的，而芸芸众生这床棉被也会把我们的温暖保存下来，我们睡在这样的被窝里不是很温暖吗？庙宇千间、钟声不绝的大寺还会是梦想吗？”</span></p><p style=\"margin-top: 20px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;box-sizing: border-box !important;word-wrap: break-word !important;\"><br style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;\"/></p><p style=\"margin-top: 20px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;box-sizing: border-box !important;word-wrap: break-word !important;\"><span style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;color: rgb(31, 73, 125);\">小和尚听了恍然大悟。从第二天开始，小和尚每天很早就下山去化缘了，依然碰到了很多人的恶语相向，可是小和尚却始终彬彬有礼的对待每一个人。</span></p><p style=\"margin-top: 20px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;box-sizing: border-box !important;word-wrap: break-word !important;\"><br style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;\"/></p><p style=\"margin-top: 20px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;box-sizing: border-box !important;word-wrap: break-word !important;\"><span style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;color: rgb(31, 73, 125);\">十年以后，菩提寺成了方圆十几公里的大寺，有了许多僧人，香客更是络绎不绝，而当年的小和尚也成了住持。</span></p><p style=\"margin-top: 20px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;box-sizing: border-box !important;word-wrap: break-word !important;\"><span style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;color: rgb(192, 0, 0);\">其实在这个世界上，我们都生活在“棉被”里，别人就是我们的棉被，当我们用心去暧棉被的时候，棉被也会给我们温暖。</span></p><p><br/></p>','','0','0','1452492588'),
('12','39','11','【技术】仔猪寄养的四种方法，总有一种你会用到','','仔猪寄养作为一项平衡每头母猪带仔数的方法或为先天不足的乳猪提供较好生长机会的方法，其好处无可怀疑。这项工作的成功程度对集约化猪场经营起到手足轻重的作用。','images/3/2016/01/SSAqQ43OboIf449frexrBaRquuH993.jpg','<h2 class=\"rich_media_title\" id=\"activity-name\" style=\"margin: 0px 0px 14px;padding: 0px 0px 10px;font-weight: 400;font-size: 24px;line-height: 1.4;border-bottom-width: 1px;border-bottom-style: solid;border-bottom-color: rgb(231, 231, 235);\">【技术】仔猪寄养的四种方法，总有一种你会用到</h2><p><span style=\"line-height: 25.6px;white-space: pre-wrap;\">仔猪寄养作为一项平衡每头母猪带仔数的方法或为先天不足的乳猪提供较好生长机会的方法，其好处无可怀疑。这项工作的成功程度对集约化猪场经营起到手足轻重的作用。</span><br/></p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;line-height: 25.6px;box-sizing: border-box !important;word-wrap: break-word !important;\"><span style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;font-size: 14px;\"></span></p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;line-height: 25.6px;box-sizing: border-box !important;word-wrap: break-word !important;\">　　</p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;line-height: 25.6px;box-sizing: border-box !important;word-wrap: break-word !important;\"><span style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;color: rgb(0, 122, 170);\"><strong style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;\">寄养原则</strong></span></p><hr style=\"margin: 0px;padding: 0px;max-width: 100%;line-height: 25.6px;box-sizing: border-box !important;word-wrap: break-word !important;\"/><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;line-height: 25.6px;box-sizing: border-box !important;word-wrap: break-word !important;\">　　<br style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;\"/></p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;line-height: 25.6px;box-sizing: border-box !important;word-wrap: break-word !important;\">1、寄养仔猪需尽快吃到足够的初乳。</p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;line-height: 25.6px;box-sizing: border-box !important;word-wrap: break-word !important;\">　　</p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;line-height: 25.6px;box-sizing: border-box !important;word-wrap: break-word !important;\">2、寄养的母猪产仔日期越接近越好，通常母猪生产日期相差不超过1天。</p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;line-height: 25.6px;box-sizing: border-box !important;word-wrap: break-word !important;\">　　</p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;line-height: 25.6px;box-sizing: border-box !important;word-wrap: break-word !important;\">3、发病窝不得往健康窝内寄养，防止疫病交叉感染。</p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;line-height: 25.6px;box-sizing: border-box !important;word-wrap: break-word !important;\">　　</p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;line-height: 25.6px;box-sizing: border-box !important;word-wrap: break-word !important;\">4、调大不调小，调强不调弱。后产的仔猪向先产的窝里寄养时，要挑选猪群里体大的寄养，先产的仔猪向后产的窝里寄养时，则要挑体重小的寄养;同期产的仔猪寄养时，则要挑体形大和体质强的寄养，以避免仔猪体重相差较大，影响体重小的仔猪生长发育。</p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;line-height: 25.6px;box-sizing: border-box !important;word-wrap: break-word !important;\">　　</p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;line-height: 25.6px;box-sizing: border-box !important;word-wrap: break-word !important;\">5、寄养时需要估计母猪的哺育能力，也就是考虑母猪是否有足够的有效乳头数，估计其母性行为，泌乳能力等。</p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;line-height: 25.6px;box-sizing: border-box !important;word-wrap: break-word !important;\">　　</p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;line-height: 25.6px;box-sizing: border-box !important;word-wrap: break-word !important;\">6、寄养最好选择同胎次的母猪代养。或者青年母猪的后代选择青年母猪代养，老母猪的后代，选择老母猪代养。</p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;line-height: 25.6px;box-sizing: border-box !important;word-wrap: break-word !important;\">　　</p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;line-height: 25.6px;box-sizing: border-box !important;word-wrap: break-word !important;\">7、在寄养的仔猪身上涂抹代养母猪的尿液，或在全群仔猪身上洒上气味相同的液体以掩盖仔猪的异味，减少母猪对寄养仔猪的排斥。</p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;line-height: 25.6px;box-sizing: border-box !important;word-wrap: break-word !important;\">　　</p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;line-height: 25.6px;box-sizing: border-box !important;word-wrap: break-word !important;\">8、仔猪寄养前，需要作好耳刺等标记与记录，以免发生系谱混乱和后期生产管理的查找。</p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;line-height: 25.6px;box-sizing: border-box !important;word-wrap: break-word !important;\">　　</p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;line-height: 25.6px;box-sizing: border-box !important;word-wrap: break-word !important;\"><span style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;color: rgb(0, 122, 170);\"><strong style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;\">寄养时间</strong></span></p><hr style=\"margin: 0px;padding: 0px;max-width: 100%;line-height: 25.6px;box-sizing: border-box !important;word-wrap: break-word !important;\"/><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;line-height: 25.6px;box-sizing: border-box !important;word-wrap: break-word !important;\">　<br style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;\"/></p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;line-height: 25.6px;box-sizing: border-box !important;word-wrap: break-word !important;\">出生3日内、4-7天、8-14天、15-21天</p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;line-height: 25.6px;box-sizing: border-box !important;word-wrap: break-word !important;\">　　</p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;line-height: 25.6px;box-sizing: border-box !important;word-wrap: break-word !important;\"><span style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;color: rgb(0, 122, 170);\"><strong style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;\">寄养方法</strong></span></p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;line-height: 25.6px;box-sizing: border-box !important;word-wrap: break-word !important;\"><span style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;line-height: 1.6;\"><br style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;\"/></span></p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;line-height: 25.6px;box-sizing: border-box !important;word-wrap: break-word !important;\"><strong style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;\"><span style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;line-height: 1.6;\">1.抚养体重太轻仔猪的寄母</span></strong></p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;line-height: 25.6px;box-sizing: border-box !important;word-wrap: break-word !important;\"><img data-s=\"300,640\" data-type=\"jpeg\" data-ratio=\"0.5935251798561151\" data-w=\"\" data-src=\"http://mmbiz.qpic.cn/mmbiz/MDPTO177MR7bCpJOz3XibX0mwqbVqHxbZjQEibugLygIB8G9V4Rm0rF8Z9NSvrlOKxNR31icry7v6Q5LMgbbK1mrw/640?wx_fmt=jpeg\" _width=\"auto\" src=\"http://mmbiz.qpic.cn/mmbiz/MDPTO177MR7bCpJOz3XibX0mwqbVqHxbZjQEibugLygIB8G9V4Rm0rF8Z9NSvrlOKxNR31icry7v6Q5LMgbbK1mrw/640?wx_fmt=jpeg&tp=webp&wxfrom=5&wx_lazy=1\" style=\"margin: 0px;padding: 0px;height: auto !important;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;line-height: 1.6;width: auto !important;visibility: visible !important;\"/><br style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;\"/></p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;line-height: 25.6px;box-sizing: border-box !important;word-wrap: break-word !important;\"><br style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;\"/></p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;line-height: 25.6px;box-sizing: border-box !important;word-wrap: break-word !important;\"><strong style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;\">操作技巧：</strong></p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;line-height: 25.6px;box-sizing: border-box !important;word-wrap: break-word !important;\">　　</p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;line-height: 25.6px;box-sizing: border-box !important;word-wrap: break-word !important;\">1)将所有的弱仔猪寄于一头母猪;</p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;line-height: 25.6px;box-sizing: border-box !important;word-wrap: break-word !important;\">　　</p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;line-height: 25.6px;box-sizing: border-box !important;word-wrap: break-word !important;\">2)寄母最好是2胎母猪且刚刚分娩结束，拥有良好的乳房分布以利于弱小仔猪容易吸吮乳汁;</p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;line-height: 25.6px;box-sizing: border-box !important;word-wrap: break-word !important;\">　　</p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;line-height: 25.6px;box-sizing: border-box !important;word-wrap: break-word !important;\">3)寄母的仔猪中体重大的仔猪在寄出前吃足初乳;</p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;line-height: 25.6px;box-sizing: border-box !important;word-wrap: break-word !important;\">　　</p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;line-height: 25.6px;box-sizing: border-box !important;word-wrap: break-word !important;\">4)弱仔猪寄养前吃足初乳。</p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;line-height: 25.6px;box-sizing: border-box !important;word-wrap: break-word !important;\">　　</p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;line-height: 25.6px;box-sizing: border-box !important;word-wrap: break-word !important;\"><strong style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;\">2.单次寄母法</strong></p><center style=\"margin: 0px;padding: 0px;max-width: 100%;line-height: 25.6px;text-align: left;box-sizing: border-box !important;word-wrap: break-word !important;\"><strong style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;line-height: 1.6;\">操作技巧：</strong></center><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;line-height: 25.6px;box-sizing: border-box !important;word-wrap: break-word !important;\">　　</p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;line-height: 25.6px;box-sizing: border-box !important;word-wrap: break-word !important;\">1)21日龄之前不要断奶，除非仔猪能够转入条件良好的保育舍;</p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;line-height: 25.6px;box-sizing: border-box !important;word-wrap: break-word !important;\">　　</p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;line-height: 25.6px;box-sizing: border-box !important;word-wrap: break-word !important;\">2)单次寄母法不容易接收仔猪;</p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;line-height: 25.6px;box-sizing: border-box !important;word-wrap: break-word !important;\">　　</p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;line-height: 25.6px;box-sizing: border-box !important;word-wrap: break-word !important;\">3)产房的热应激对寄母有着相当大的风险。</p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;line-height: 25.6px;box-sizing: border-box !important;word-wrap: break-word !important;\">　　</p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;line-height: 25.6px;box-sizing: border-box !important;word-wrap: break-word !important;\"><strong style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;\">3、二次寄母法</strong></p><center style=\"margin: 0px;padding: 0px;max-width: 100%;line-height: 25.6px;box-sizing: border-box !important;word-wrap: break-word !important;\"><img data-s=\"300,640\" data-type=\"jpeg\" data-ratio=\"0.6420863309352518\" data-w=\"\" data-src=\"http://mmbiz.qpic.cn/mmbiz/MDPTO177MR7bCpJOz3XibX0mwqbVqHxbZ6cmria2wUhevNkp8G07RpXFtBhl6OcdM9g9tebLc980HD1gRCicyvBsA/640?wx_fmt=jpeg\" _width=\"auto\" src=\"http://mmbiz.qpic.cn/mmbiz/MDPTO177MR7bCpJOz3XibX0mwqbVqHxbZ6cmria2wUhevNkp8G07RpXFtBhl6OcdM9g9tebLc980HD1gRCicyvBsA/640?wx_fmt=jpeg&tp=webp&wxfrom=5&wx_lazy=1\" style=\"margin: 0px;padding: 0px;height: auto !important;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;width: auto !important;visibility: visible !important;\"/><br style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;\"/></center><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;line-height: 25.6px;box-sizing: border-box !important;word-wrap: break-word !important;\"><strong style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;\">操作技巧：</strong></p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;line-height: 25.6px;box-sizing: border-box !important;word-wrap: break-word !important;\">　　</p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;line-height: 25.6px;box-sizing: border-box !important;word-wrap: break-word !important;\">1)出生后12小时，低体重仔猪已经获得足够的初乳;</p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;line-height: 25.6px;box-sizing: border-box !important;word-wrap: break-word !important;\">　　</p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;line-height: 25.6px;box-sizing: border-box !important;word-wrap: break-word !important;\">2)低体重的仔猪可以在出生后12小时寄养;</p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;line-height: 25.6px;box-sizing: border-box !important;word-wrap: break-word !important;\">　　</p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;line-height: 25.6px;box-sizing: border-box !important;word-wrap: break-word !important;\">3)母猪在分娩后24小时之内提供初乳。</p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;line-height: 25.6px;box-sizing: border-box !important;word-wrap: break-word !important;\">　　</p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;line-height: 25.6px;box-sizing: border-box !important;word-wrap: break-word !important;\"><strong style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;\">4、寄母寄养法</strong></p><center style=\"margin: 0px;padding: 0px;max-width: 100%;line-height: 25.6px;text-align: left;box-sizing: border-box !important;word-wrap: break-word !important;\"><img data-s=\"300,640\" data-type=\"jpeg\" data-ratio=\"0.5971223021582733\" data-w=\"\" data-src=\"http://mmbiz.qpic.cn/mmbiz/MDPTO177MR7bCpJOz3XibX0mwqbVqHxbZnG4IGR1IHTbkq0BxEbk2wsdO1BwcqJbAq6CoxDJHSkamlEp3myFAaw/640?wx_fmt=jpeg\" _width=\"auto\" src=\"http://mmbiz.qpic.cn/mmbiz/MDPTO177MR7bCpJOz3XibX0mwqbVqHxbZnG4IGR1IHTbkq0BxEbk2wsdO1BwcqJbAq6CoxDJHSkamlEp3myFAaw/640?wx_fmt=jpeg&tp=webp&wxfrom=5&wx_lazy=1\" style=\"margin: 0px;padding: 0px;height: auto !important;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;width: auto !important;visibility: visible !important;\"/><br style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;\"/><strong style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;\"><span style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;line-height: 1.6;\">操作技巧：</span></strong></center><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;line-height: 25.6px;box-sizing: border-box !important;word-wrap: break-word !important;\">　　</p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;line-height: 25.6px;box-sizing: border-box !important;word-wrap: break-word !important;\">1)早上放12个夹子于口袋中。</p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;line-height: 25.6px;box-sizing: border-box !important;word-wrap: break-word !important;\">　　</p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;line-height: 25.6px;box-sizing: border-box !important;word-wrap: break-word !important;\">2)每看到一头弱仔猪便在母猪卡片上夹一个夹子。</p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;line-height: 25.6px;box-sizing: border-box !important;word-wrap: break-word !important;\">　　</p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;line-height: 25.6px;box-sizing: border-box !important;word-wrap: break-word !important;\">3)口袋里的夹子用完后，寻找一头抚养有 12~13 头已准备好断奶的母猪，然后移走她抚养的仔猪。</p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;line-height: 25.6px;box-sizing: border-box !important;word-wrap: break-word !important;\">　　</p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;line-height: 25.6px;box-sizing: border-box !important;word-wrap: break-word !important;\">4)把母猪卡片上有夹子的12头弱仔猪寄养给这头母猪。</p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;line-height: 25.6px;box-sizing: border-box !important;word-wrap: break-word !important;\">　　</p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;line-height: 25.6px;box-sizing: border-box !important;word-wrap: break-word !important;\"><span style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;color: rgb(0, 122, 170);\"><strong style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;\">负责人员</strong></span></p><hr style=\"margin: 0px;padding: 0px;max-width: 100%;line-height: 25.6px;box-sizing: border-box !important;word-wrap: break-word !important;\"/><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;line-height: 25.6px;box-sizing: border-box !important;word-wrap: break-word !important;\">　　<br style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;\"/></p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;line-height: 25.6px;box-sizing: border-box !important;word-wrap: break-word !important;\">0-3日龄内仔猪由接产组组长负责寄养，主要调整大小、多少；</p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;line-height: 25.6px;box-sizing: border-box !important;word-wrap: break-word !important;\">　　</p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;line-height: 25.6px;box-sizing: border-box !important;word-wrap: break-word !important;\">4日龄以上阶段寄养工作由主管负责。</p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;line-height: 25.6px;box-sizing: border-box !important;word-wrap: break-word !important;\">　　</p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;line-height: 25.6px;box-sizing: border-box !important;word-wrap: break-word !important;\"><span style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;color: rgb(0, 122, 170);\"><strong style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;\">检查标准</strong></span><span style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;line-height: 1.6;\">　</span></p><hr style=\"margin: 0px;padding: 0px;max-width: 100%;line-height: 25.6px;box-sizing: border-box !important;word-wrap: break-word !important;\"/><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;line-height: 25.6px;box-sizing: border-box !important;word-wrap: break-word !important;\">　<br style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;\"/></p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;line-height: 25.6px;box-sizing: border-box !important;word-wrap: break-word !important;\">各单元窝内整齐度基本一致，哺乳时无仔猪抢奶现象为宜。</p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;line-height: 25.6px;box-sizing: border-box !important;word-wrap: break-word !important;\"><br style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;\"/></p><p></p><p><section class=\"yead_editor\" label=\"Copyright © 2015 Yead All Rights Reserved.\" style=\"margin: 0px;padding: 0px;max-width: 100%;line-height: 25.6px;box-sizing: border-box !important;word-wrap: break-word !important;\"><section class=\"yead\" style=\"margin: -1px 0px 0px;padding: 20px 0px 0px;max-width: 100%;box-sizing: border