('16','45','0','庆平台顺利开通，人工乳“好妈妈”限时抢购中','zhp','庆平台顺利开通，人工乳“好妈妈”限时抢购中','images/3/2016/01/mUwM1nRMzQMNAmZ9A7NnyNnkaBY9Q7.jpg','<p><span style=\";font-family:Calibri;font-size:16px\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;为了庆祝<span style=\"font-family:Calibri\">“</span><span style=\"font-family:宋体\">饲料微商</span><span style=\"font-family:Calibri\">”</span><span style=\"font-family:宋体\">线上交易平台顺利开通，感谢广大客户对</span><span style=\"font-family:Calibri\">“</span><span style=\"font-family:宋体\">三星牧业</span><span style=\"font-family:Calibri\">”</span><span style=\"font-family:宋体\">的关爱和支持，自</span><span style=\"font-family:Calibri\">2016</span><span style=\"font-family:宋体\">年</span><span style=\"font-family:Calibri\">1</span><span style=\"font-family:宋体\">月</span><span style=\"font-family:Calibri\">16</span><span style=\"font-family:宋体\">日至</span><span style=\"font-family:Calibri\">1</span><span style=\"font-family:宋体\">月</span><span style=\"font-family:Calibri\">22</span><span style=\"font-family:宋体\">日，本平台持续开展线上限时抢购活动，具体规则如下：</span></span></p><p><span style=\";font-family:Calibri;font-size:16px\">&nbsp;&nbsp;&nbsp;<span style=\"font-family:宋体\">一、活动内容：</span></span></p><p><span style=\";font-family:Calibri;font-size:16px\">&nbsp;&nbsp;&nbsp;1<span style=\"font-family:宋体\">、活动期间原价</span><span style=\"font-family:Calibri\">50</span><span style=\"font-family:宋体\">元</span><span style=\"font-family:Calibri\">/</span><span style=\"font-family:宋体\">袋的仔猪人工乳</span><span style=\"font-family: Calibri;font-size: 16px;color: rgb(255, 0, 0);\"><span style=\"font-family: Calibri;\">“</span><span style=\"font-family: 宋体;\">好妈妈</span><span style=\"font-family: Calibri;\">”</span></span><span style=\"font-family:宋体\">每天</span><span style=\"font-family:Calibri\">10</span><span style=\"font-family:宋体\">：</span><span style=\"font-family:Calibri\">00-11</span><span style=\"font-family:宋体\">：</span><span style=\"font-family:Calibri\">00</span><span style=\"font-family:宋体\">抢购仅需</span><span style=\"font-family:Calibri\">10</span><span style=\"font-family:宋体\">元</span><span style=\"font-family:Calibri\">/</span><span style=\"font-family:宋体\">袋。</span></span></p><p><span style=\";font-family:Calibri;font-size:16px\">&nbsp;&nbsp;&nbsp;2<span style=\"font-family:宋体\">、每个会员抢购时间段内最多抢购</span><span style=\"font-family:Calibri\">10</span><span style=\"font-family:宋体\">袋。</span></span></p><p><span style=\";font-family:Calibri;font-size:16px\">&nbsp;&nbsp;&nbsp;<span style=\"font-family:宋体\">二、抢购方法：</span></span></p><p><span style=\";font-family:Calibri;font-size:16px\">&nbsp;&nbsp;&nbsp;1<span style=\"font-family:宋体\">、公众平台输入</span><span style=\"font-family:Calibri\">“</span><span style=\"font-family:宋体\">抢购</span><span style=\"font-family:Calibri\">”</span><span style=\"font-family:宋体\">，点击</span><span style=\"font-family:Calibri\">“</span><span style=\"font-family:宋体\">查看全文</span><span style=\"font-family:Calibri\">”</span><span style=\"font-family:宋体\"></span>详细查看本次活动内容<span style=\"font-family:宋体\">。</span></span></p><p><span style=\";font-family:Calibri;font-size:16px\">&nbsp;&nbsp;&nbsp;2<span style=\"font-family:宋体\">、进入平台后，点击</span><span style=\"font-family:Calibri\">“</span><span style=\"font-family:宋体\">饲料商城</span><span style=\"font-family:Calibri\">”</span><span style=\"font-family:宋体\">选择</span><span style=\"font-family:Calibri\">“</span><span style=\"font-family:宋体\">抢购商品</span><span style=\"font-family:Calibri\">”</span><span style=\"font-family:宋体\">，规定时间段内进入跳转页面直接选择</span><span style=\"font-family:Calibri\">“直接</span><span style=\"font-family:宋体\">购买</span><span style=\"font-family:Calibri\">”</span><span style=\"font-family:宋体\">按提示操作即可。</span></span></p><p><span style=\";font-family:Calibri;font-size:16px\">&nbsp;&nbsp;&nbsp;<span style=\"font-family:宋体\">三：声明</span></span></p><p><span style=\";font-family:Calibri;font-size:16px\">&nbsp;&nbsp;&nbsp;1<span style=\"font-family:宋体\">、本品为促销产品，本品</span><span style=\"font-family:Calibri\">10</span><span style=\"font-family:宋体\">袋以上或配合公司其他平台产品均包邮，运费公司承担，订购本产品</span><span style=\"font-family:Calibri\">10</span><span style=\"font-family:宋体\">袋以下，运费需自行承担</span></span><span style=\";font-family:&#39;Times New Roman&#39;;font-weight:bold\">（省内运费约<span style=\"font-family:Times New Roman\">5</span><span style=\"font-family:宋体\">元，省外运费约</span><span style=\"font-family:Times New Roman\">20</span><span style=\"font-family:宋体\">元，以实际发生金额为准）。</span></span></p><p><span style=\";font-family:Calibri;font-size:16px\">&nbsp;&nbsp;&nbsp;2<span style=\"font-family:宋体\">、订购后公司采用物流方式投送，河南省内仅投送至县级以上物流点，省外仅投送至市级以上物流点。</span></span></p><p><br/></p>','http://market.hasxmy.com/we4/app/index.php?i=3&c=entry&p=detail&id=32&do=shop&m=ewei_shop','11','1','1453991495'),
('17','48','0','平台升级通知','张会朋','元月23日-元月28日平台持续升级（详见店铺公告）','images/3/2016/01/CyO0why1j607ZhFpZPObjbw1PbpO72.jpg','<p style=\"text-align:justify;text-justify:inter-ideograph\"><span style=\";font-family:宋体;font-weight:bold;font-size:14px\">各位亲们：</span></p><p style=\"text-indent:28px;text-align:justify;text-justify:inter-ideograph\"><span style=\"font-family: 宋体;font-size: 14px\">首先感谢大家对“饲料微商”的关注和支持，为了能更好地为大家提供服务，经研究决定自<span style=\"font-family:Calibri\">2016</span><span style=\"font-family:宋体\">年元月</span><span style=\"font-family:Calibri\">23</span><span style=\"font-family:宋体\">日</span><span style=\"font-family:Calibri\">-</span><span style=\"font-family:宋体\">元月</span><span style=\"font-family:Calibri\">31</span><span style=\"font-family:宋体\">日开展平台持续升级工作，主要升级内容主要有：</span></span></p><p style=\"text-align:justify;text-justify:inter-ideograph\"><span style=\";font-family:宋体;font-weight:bold;font-size:14px\">&nbsp;&nbsp;1<span style=\"font-family:宋体\">、菜单的变更和调整</span></span></p><p style=\"text-align:justify;text-justify:inter-ideograph\"><span style=\";font-family:宋体;font-weight:bold;font-size:14px\">&nbsp;&nbsp;2<span style=\"font-family:宋体\">、店面装修和美化</span></span></p><p style=\"text-align:justify;text-justify:inter-ideograph\"><span style=\";font-family:宋体;font-weight:bold;font-size:14px\">&nbsp;&nbsp;3<span style=\"font-family:宋体\">、个别功能性模块调整。</span></span></p><p style=\"text-align:justify;text-justify:inter-ideograph\"><span style=\";font-family:宋体;font-weight:bold;font-size:14px\">&nbsp;&nbsp;4<span style=\"font-family:宋体\">、会员分组管理。</span></span></p><p style=\"text-indent:28px;text-align:justify;text-justify:inter-ideograph\"><span style=\"font-family: 宋体;font-size: 14px\">因系统升级给您带来的不便我们深表歉意，升级期间我们将会采用边运营边升级的的方法，并向大家承诺，升级不会影响您的：</span></p><p style=\"text-align:justify;text-justify:inter-ideograph\"><span style=\";font-family:宋体;font-weight:bold;font-size:14px\">&nbsp;&nbsp;1<span style=\"font-family:宋体\">、会员等级和佣金分成。</span></span></p><p style=\"text-align:justify;text-justify:inter-ideograph\"><span style=\";font-family:宋体;font-weight:bold;font-size:14px\">&nbsp;&nbsp;2<span style=\"font-family:宋体\">、商品订购和发货。</span></span></p><p style=\"text-align:justify;text-justify:inter-ideograph\"><span style=\";font-family:宋体;font-weight:bold;font-size:14px\">&nbsp;&nbsp;3<span style=\"font-family:宋体\">、余额和微信支付的安全。</span></span></p><p style=\"text-indent:28px;text-align:justify;text-justify:inter-ideograph\"><span style=\"font-family: 宋体;font-size: 14px\">再次感谢大家的支持和配合，在使用过程中如您遇到不明白之处，请致电：<span style=\"font-family:Calibri\">4009939099</span><span style=\"font-family:宋体\">转业务咨询，或联系在线客服</span><span style=\"font-family:Calibri\">QQ</span><span style=\"font-family:宋体\">：</span><span style=\"font-family:Calibri\">390071985</span><span style=\"font-family:宋体\">，升级期间将会为您提供全天</span><span style=\"font-family:Calibri\">24</span><span style=\"font-family:宋体\">小时服务。</span></span></p><p style=\"text-indent:28px;text-align:justify;text-justify:inter-ideograph\"><span style=\"font-family: 宋体;font-size: 14px\">&nbsp;</span></p><p style=\"text-indent:28px;text-align:justify;text-justify:inter-ideograph\"><span style=\";font-family:宋体;font-weight:bold;font-size:14px\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;饲料微商电子商务管理中心</span></p><p style=\"text-indent:28px;text-align:justify;text-justify:inter-ideograph\"><span style=\";font-family:宋体;font-weight:bold;font-size:14px\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;2016<span style=\"font-family:宋体\">年</span><span style=\"font-family:Calibri\">1</span><span style=\"font-family:宋体\">月</span><span style=\"font-family:Calibri\">23</span><span style=\"font-family:宋体\">日&nbsp;</span></span></p><p style=\"text-indent:28px;text-align:justify;text-justify:inter-ideograph\"><span style=\";font-family:宋体;font-weight:bold;font-size:14px\">&nbsp;</span></p><p><br/></p>','','20','1','1453991521'),
('21','54','0','电子商务平台操作指南','运营部','电子商务平台操作指南','images/3/2016/01/NnUnqt7DDnPdWlnsbz9AupTPwZWHhj.jpg','<p><span style=\";font-family:宋体;font-size:14px\"><img src=\"http://market.hasxmy.com/attachment/images/3/2016/02/VSe2Bi842S6n1SZ1XzU8qpQ4usbS2i.gif\" width=\"100%\" alt=\"images/3/2016/02/VSe2Bi842S6n1SZ1XzU8qpQ4usbS2i.gif\"/></span></p><p><span style=\";font-family:宋体;font-size:14px\">&nbsp;</span><span style=\"font-family: 宋体; font-size: 14px;\">&nbsp;</span><span style=\"font-family: 宋体; font-size: 14px;\">亲：感谢您关注“饲料微商”电子商务平台，为了方便您的使用，现把本平台的详细操作方法介绍如下：</span></p><p style=\"text-indent:28px\"><span style=\";font-family:宋体;font-weight:bold;font-size:14px\">第一部分：平台运行要求</span></p><p style=\"text-indent:28px\"><span style=\";font-family:宋体;font-size:14px\">本平台基于腾讯微信基础开发，凡是支持运行“微信”程序的手机和其他电子设备均可运行本平台（本指南以安卓系统手机为例）。</span></p><p style=\"text-indent:28px\"><span style=\";font-family:宋体;font-weight:bold;font-size:14px\">第二部分：</span><span style=\";font-family:宋体;font-weight:bold;font-size:14px\">如何关注公众号</span></p><p style=\"text-indent:28px\"><span style=\"font-family: 宋体;font-size: 14px\">本平台基于公司微信公众号开发，请您在进行操作之前务必关注“饲料微商”微信公众号，以便平台为您提供更多服务。</span></p><p style=\"text-indent:28px\"><span style=\";font-family:宋体;font-weight:bold;font-size:14px\">一、微信搜索关注</span></p><p style=\"text-indent:28px\"><span style=\"font-family: 宋体; font-size: 14px;\">运行手机微信进入首页点击搜索按钮:</span></p><p style=\"text-indent:28px\"><span style=\";font-family:&#39;Times New Roman&#39;;font-size:14px\"><img src=\"http://market.hasxmy.com/attachment/images/3/2016/01/m2ma8Eu1Z2QfvJj8hjJHu822l1e2E2.jpg\" width=\"100%\" alt=\"微信搜索_副本.jpg\"/></span><span style=\"font-size: 14px;\"><span style=\"font-family:宋体\">&nbsp;&nbsp;</span><span style=\"font-family: &#39;Times New Roman&#39;; text-indent: 28px; font-size: 14px;\">输入“<span style=\"font-family: 宋体;\">饲料微商</span>”<span style=\"font-family: 宋体;\">或</span>“sxmy4009939099”,<span style=\"font-size: 14px; text-indent: 28px; font-family: 宋体;\">点击</span><span style=\"font-family: &#39;Times New Roman&#39;; font-size: 14px; text-indent: 28px;\">“</span><span style=\"font-size: 14px; text-indent: 28px; font-family: 宋体;\">搜一搜</span><span style=\"font-family: &#39;Times New Roman&#39;; font-size: 14px; text-indent: 28px;\">”</span></span></span></p><p style=\"text-indent:28px\"><span style=\"font-size: 14px;\"><span style=\"font-family: &#39;Times New Roman&#39;; text-indent: 28px; font-size: 14px;\"><span style=\"font-family: 宋体;\"><img src=\"http://market.hasxmy.com/attachment/images/3/2016/01/yB4RbqbZ54dPJqp11rE55NpbDOaqX5.jpg\" width=\"100%\" alt=\"输入饲料微商.jpg\"/></span></span></span></p><p style=\"text-indent:28px\"><span style=\"font-size: 14px;\"><span style=\"font-family: &#39;Times New Roman&#39;; text-indent: 28px; font-size: 14px;\">进入提示页面点击“<span style=\"font-family: 宋体;\">关注</span>”</span></span></p><p style=\"text-indent:28px\"><span style=\"font-size: 14px;\"><span style=\"font-family: &#39;Times New Roman&#39;; text-indent: 28px; font-size: 14px;\"><span style=\"font-family: 宋体;\"><img src=\"http://market.hasxmy.com/attachment/images/3/2016/01/BNnh1cknn3Q6M1cMi7KK6QuK7mqnim.jpg\" width=\"100%\" alt=\"获取通知.jpg\"/> &nbsp;&nbsp;</span></span></span><span style=\"font-size: 14px; font-family: &#39;Times New Roman&#39;;\"><span style=\"font-family: 宋体;\">然后确认</span></span><span style=\"font-size: 14px; font-family: 宋体;\">，</span><span style=\"font-size: 14px; font-family: &#39;Times New Roman&#39;;\">进入平台欢迎页面</span></p><p style=\"text-indent:28px\"><span style=\"font-size: 14px; font-family: &#39;Times New Roman&#39;;\"><img src=\"http://market.hasxmy.com/attachment/images/3/2016/01/Fz29re6xK98z2VO94e9892yoerny0y.jpg\" width=\"100%\" alt=\"进入欢迎页面.jpg\"/> &nbsp; &nbsp; &nbsp;&nbsp;</span><span style=\"font-family: 宋体; font-size: 14px; font-weight: bold;\">二、扫码关注</span></p><p style=\"text-indent:28px\"><span style=\";font-family:宋体;font-size:14px\">在宣传页、名片、文章等其他宣传介质中找到“饲料微商”二维码。</span></p><p style=\"text-indent:28px\"><span style=\";font-family:宋体;font-size:14px\"><img src=\"http://market.hasxmy.com/attachment/images/3/2016/03/IxCD92jC11X1a821c93Z8r3BZcj2GY.png\" width=\"100%\" alt=\"images/3/2016/03/IxCD92jC11X1a821c93Z8r3BZcj2GY.png\"/> &nbsp;&nbsp;</span><span style=\"font-family: 宋体; font-size: 14px;\">打开微信，点击“发现”。</span></p><p style=\"text-indent:28px\"><span style=\"font-family: 宋体; font-size: 14px;\"><img src=\"http://market.hasxmy.com/attachment/images/3/2016/03/Fc21I7hSnbHD3NNDzqbnnNND51hNiH.jpg\" width=\"100%\" alt=\"images/3/2016/03/Fc21I7hSnbHD3NNDzqbnnNND51hNiH.jpg\"/>&nbsp;&nbsp;<span style=\"font-family: 宋体; font-size: 14px; text-indent: 28px;\">点击“扫一扫”。</span></span></p><p style=\"text-indent:28px\"><span style=\"font-family: 宋体; font-size: 14px;\"><span style=\"font-family: 宋体; font-size: 14px; text-indent: 28px;\"><img src=\"http://market.hasxmy.com/attachment/images/3/2016/03/e1HGekpv1ERKEEKsdzMgh0MHKNMeZ7.png\" width=\"100%\" alt=\"images/3/2016/03/e1HGekpv1ERKEEKsdzMgh0MHKNMeZ7.png\"/>&nbsp; &nbsp;</span></span><span style=\"font-family: 宋体; font-size: 14px;\">对准二维码扫描。</span></p><p style=\"text-indent: 28px; text-align: right;\"><span style=\"font-family: 宋体; font-size: 14px;\">&nbsp;<img src=\"http://market.hasxmy.com/attachment/images/3/2016/03/voQYO14fyfc4YbQv0IfWqv11Qe1eEf.jpg\" width=\"470\" alt=\"images/3/2016/03/voQYO14fyfc4YbQv0IfWqv11Qe1eEf.jpg\" height=\"894\" style=\"width: 470px; height: 894px;\"/></span></p><p style=\"text-indent:28px\"><span style=\"font-family: 宋体; font-size: 14px;\">点击“关注”。</span></p><p style=\"text-indent:28px\"><span style=\"font-family: 宋体; font-size: 14px;\"><img src=\"http://market.hasxmy.com/attachment/images/3/2016/01/BNnh1cknn3Q6M1cMi7KK6QuK7mqnim.jpg\" width=\"100%\" alt=\"获取通知.jpg\"/></span></p><p style=\"text-indent:28px\"><span style=\"font-family: 宋体; font-size: 14px;\">&nbsp;进入公众号，点击“确认”。</span></p><p style=\"text-indent: 28px; text-align: right;\"><span style=\"font-family: 宋体; font-size: 14px;\">&nbsp;<img src=\"http://market.hasxmy.com/attachment/images/3/2016/03/FJyMwA11MjJ1hJAz0Ax1Dqjlz2m1dZ.png\" width=\"473\" alt=\"images/3/2016/03/FJyMwA11MjJ1hJAz0Ax1Dqjlz2m1dZ.png\" height=\"894\" style=\"width: 473px; height: 894px;\"/></span></p><p style=\"text-indent:28px\"><span style=\"font-family: 宋体; font-size: 14px;\">&nbsp;进入欢迎页面。</span></p><p style=\"text-indent:28px\"><span style=\"font-family: 宋体; font-size: 14px;\"><img src=\"http://market.hasxmy.com/attachment/images/3/2016/01/Fz29re6xK98z2VO94e9892yoerny0y.jpg\" width=\"100%\" alt=\"进入欢迎页面.jpg\"/>&nbsp;&nbsp;</span><span style=\"font-family: 宋体; font-size: 14px; font-weight: bold;\">三、阅读关注</span></p><p style=\"text-indent:28px\"><span style=\";font-family:宋体;font-size:14px\">在微信中阅读本平台发布的图文消息，按提示文章“点击蓝色字体关注”提示，点击“</span><span style=\";font-family:宋体;color:rgb(91,155,213);font-size:14px\">饲料微商</span><span style=\";font-family:宋体;font-size:14px\">”添加关注。</span></p><p style=\"text-indent:28px\"><span style=\";font-family:宋体;font-size:14px\"><img src=\"http://market.hasxmy.com/attachment/images/3/2016/03/vxfYR0lcqQEMWrKYcaJ0lyQgRhMJAY.jpg\" width=\"100%\" alt=\"images/3/2016/03/vxfYR0lcqQEMWrKYcaJ0lyQgRhMJAY.jpg\"/></span></p><p style=\"text-indent:28px\"><span style=\";font-family:宋体;font-size:14px\">点击“关注”，进入公众号。点击“确认”，进入欢迎页面。</span></p><p style=\"text-indent: 28px; text-align: right;\"><span style=\"font-family: 宋体; font-size: 14px;\"></span><img src=\"http://market.hasxmy.com/attachment/images/3/2016/01/BNnh1cknn3Q6M1cMi7KK6QuK7mqnim.jpg\" width=\"478\" alt=\"获取通知.jpg\" height=\"894\" style=\"width: 478px; height: 894px;\"/></p><p style=\"text-indent:28px\"><span style=\"font-size: 14px; font-family: &#39;Times New Roman&#39;;\"></span></p><p>&nbsp;&nbsp;<span style=\"font-family: 宋体; font-size: 14px; text-indent: 28px;\">点击“确认”。</span></p><p><span style=\"font-family: 宋体; font-size: 14px; text-indent: 28px;\">&nbsp; &nbsp;<img src=\"http://market.hasxmy.com/attachment/images/3/2016/03/FJyMwA11MjJ1hJAz0Ax1Dqjlz2m1dZ.png\" width=\"468\" alt=\"点击确定.png\" height=\"894\" style=\"width: 468px; height: 894px;\"/> &nbsp; &nbsp;进入欢迎页面。</span></p><p style=\"text-align: right;\"><span style=\"font-family: 宋体; font-size: 14px; text-indent: 28px;\">&nbsp; &nbsp;<img src=\"http://market.hasxmy.com/attachment/images/3/2016/01/Fz29re6xK98z2VO94e9892yoerny0y.jpg\" width=\"461\" alt=\"进入欢迎页面.jpg\" height=\"894\" style=\"width: 461px; height: 894px;\"/></span></p><p style=\"text-align: left;\"><span style=\"font-family: 宋体; font-size: 14px; text-indent: 28px;\"> &nbsp; &nbsp;</span></p><p><span style=\";font-family:宋体;font-weight:bold;font-size:14px\">&nbsp; &nbsp;四、微信消息或朋友圈推广后关注</span></p><p style=\"text-indent:28px\"><span style=\"font-family: 宋体;font-size: 14px\">当您的通过朋友圈或微信消息向您发送“饲料微商”海报或链接时，点击打开。</span></p><p style=\"text-indent: 28px; text-align: right;\"><span style=\"font-family: 宋体; font-size: 14px;\"><img src=\"http://market.hasxmy.com/attachment/images/3/2016/03/Q808gYcY0h4qHN4087H0z8rh77gG04.jpg\" width=\"494\" alt=\"images/3/2016/03/Q808gYcY0h4qHN4087H0z8rh77gG04.jpg\" height=\"838\" style=\"width: 494px; height: 838px;\"/></span></p><p style=\"text-indent:28px\"><span style=\"font-family: 宋体; font-size: 14px;\">海报时长按图片任何位置</span><span style=\"font-size: 14px; font-family: &#39;Times New Roman&#39;;\">3-5</span><span style=\"font-family: 宋体; font-size: 14px;\">秒后，出现识别图中二维码后，点击“识别图中二维码”进入饲料微商平台。</span></p><p style=\"text-indent:28px\"><span style=\"font-family: 宋体; font-size: 14px;\"><img src=\"http://market.hasxmy.com/attachment/images/3/2016/03/dRVLgQv2uV33K3NaKB9uVSqZ3VlN2V.jpg\" width=\"100%\" alt=\"images/3/2016/03/dRVLgQv2uV33K3NaKB9uVSqZ3VlN2V.jpg\"/></span></p><p style=\"text-indent:28px\"><span style=\"font-family: 宋体; font-size: 14px;\">链接或朋友圈直接点击打开即可，跳转后点击“立即关注”进入平台关注引导页。</span></p><p style=\"text-indent:28px\"><span style=\"font-family: 宋体; font-size: 14px;\"><img src=\"http://market.hasxmy.com/attachment/images/3/2016/03/hoOod9S7102s92OEz79F7eFc2OU4Co.jpg\" width=\"100%\" alt=\"images/3/2016/03/hoOod9S7102s92OEz79F7eFc2OU4Co.jpg\"/></span></p><p style=\"text-indent:28px\"><span style=\"font-family: 宋体; font-size: 14px;\">&nbsp;点击蓝色字体，添加关注即可。</span></p><p style=\"text-indent: 28px; text-align: right;\"><span style=\"font-family: 宋体; font-size: 14px;\">&nbsp;<img src=\"http://market.hasxmy.com/attachment/images/3/2016/03/wzQM7IUwL9I4L7S7QMQEMS9sTojtqS.jpg\" width=\"472\" alt=\"images/3/2016/03/wzQM7IUwL9I4L7S7QMQEMS9sTojtqS.jpg\" height=\"894\" style=\"width: 472px; height: 894px;\"/></span></p><p style=\"text-align: left;\"><span style=\"font-family: 宋体; font-size: 14px; text-indent: 28px;\"></span><br/></p><p><span class=\"edui-editor-imagescale-hand0\" style=\"box-sizing: border-box;position: absolute;width: 6px;height: 6px;overflow: hidden;font-size: 0px;display: block;cursor: nw-resize;top: 0px;margin-top: -4px;left: 0px;margin-left: -4px;color: rgb(51, 51, 51);font-family: arial, &#39;Hiragino Sans GB&#39;, &#39;Microsoft Yahei&#39;, 微软雅黑, 宋体, 宋体, Tahoma, Arial, Helvetica, STHeiti;background-color: rgb(60, 157, 208);\"></span><span class=\"edui-editor-imagescale-hand1\" style=\"box-sizing: border-box;position: absolute;width: 6px;height: 6px;overflow: hidden;font-size: 0px;display: block;cursor: n-resize;top: 0px;margin-top: -4px;left: 169px;margin-left: -4px;color: rgb(51, 51, 51);font-family: arial, &#39;Hiragino Sans GB&#39;, &#39;Microsoft Yahei&#39;, 微软雅黑, 宋体, 宋体, Tahoma, Arial, Helvetica, STHeiti;background-color: rgb(60, 157, 208);\"></span><span class=\"edui-editor-imagescale-hand2\" style=\"box-sizing: border-box;position: absolute;width: 6px;height: 6px;overflow: hidden;font-size: 0px;display: block;cursor: ne-resize;top: 0px;margin-top: -4px;left: 338px;margin-left: -3px;color: rgb(51, 51, 51);font-family: arial, &#39;Hiragino Sans GB&#39;, &#39;Microsoft Yahei&#39;, 微软雅黑, 宋体, 宋体, Tahoma, Arial, Helvetica, STHeiti;background-color: rgb(60, 157, 208);\"></span><span class=\"edui-editor-imagescale-hand3\" style=\"box-sizing