('25','61','0','总算凑全了，规模养猪场中常用的18种疫苗及免疫程序介绍','','','images/3/2016/02/jK8gPYZRSRiU93P296uzkur3e12601.png','<p style=\";padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;clear: both;min-height: 1em;white-space: pre-wrap;color: rgb(62, 62, 62);font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif;line-height: 25px;background-color: white\"><strong style=\";padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important\"><span style=\";padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;font-size: 14px\">1.</span></strong><strong style=\";padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important\"><span style=\";padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;font-size: 14px\">猪瘟弱毒疫苗</span></strong><br style=\";padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important\"/></p><p style=\";padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;clear: both;min-height: 1em;white-space: pre-wrap;color: rgb(62, 62, 62);font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif;line-height: 25px;background-color: white\"><span style=\";padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;font-size: 14px\">猪瘟弱毒活疫苗的免疫程序：</span><span style=\";padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;font-size: 14px\">①</span><span style=\";padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;font-size: 14px\">仔猪<span style=\";padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important\">20</span>日龄首免，<span style=\";padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important\">60</span>日龄左右做第二免疫接种<span style=\";padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important\">;</span></span><span style=\";padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;font-size: 14px\">②</span><span style=\";padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;font-size: 14px\">乳前免疫：初生仔猪在吃初乳前进行免疫接种，<span style=\";padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important\">1</span>～<span style=\";padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important\">2</span>小时后再哺乳，在<span style=\";padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important\">60</span>日龄左右做第二次免疫接种。乳前免疫不仅费时、费力，而且需要很强的责任心，因此，一般存在有仔猪猪瘟，特别是哺乳阶段易发生猪瘟和母猪带毒比较严重的猪场，建议采用这一免疫程序<span style=\";padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important\">;</span></span><span style=\";padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;font-size: 14px\">③</span><span style=\";padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;font-size: 14px\">后备种猪在配种前<span style=\";padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important\">1</span>个月再免疫<span style=\";padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important\">1</span>次<span style=\";padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important\">;</span></span><span style=\";padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;font-size: 14px\">④</span><span style=\";padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;font-size: 14px\">繁殖母猪在哺乳仔猪断奶时进行免疫接种<span style=\";padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important\">;</span></span><span style=\";padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;font-size: 14px\">⑤</span><span style=\";padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;font-size: 14px\">种公猪每年免疫接种<span style=\";padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important\">2</span>次。</span></p><p style=\";padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;clear: both;min-height: 1em;white-space: pre-wrap;color: rgb(62, 62, 62);font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif;line-height: 25px;background-color: white\"><span style=\";padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;font-size: 14px\">猪瘟兔化弱毒疫苗的免疫程序应根据猪场猪瘟的流行与发生情况和母源抗体水平等因素而制定。同时，应加强环境、猪舍的消毒卫生，以减少或杜绝猪瘟强毒的污染。</span></p><p><br/></p>','','0','1','1456380974'),
('26','62','0','【技术】25天的断奶仔猪重9kg！怎么做到的？','','仔猪断奶重对商品猪一生的生长性能都有明显的正相关。有报道称，断奶体重多 1kg，出栏时间可以缩短大约10d，饲料效率提高 \n3%~5%，因此，相同日龄仔猪的断奶体重越大越好。','images/3/2016/02/T00tt0bBFZuGbe0tS8buBLBbUZ8FS8.jpg','<h2 class=\"rich_media_title\" id=\"activity-name\" style=\"margin: 0px 0px 14px; padding: 0px 0px 10px; font-weight: 400; font-size: 24px; line-height: 1.4; border-bottom-width: 1px; border-bottom-style: solid; border-bottom-color: rgb(231, 231, 235); \">【技术】25天的断奶仔猪重9kg！怎么做到的？</h2><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; white-space: pre-wrap; \"><br/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; white-space: pre-wrap; line-height: 25.6px; widows: 1; \">仔猪断奶重对商品猪一生的生长性能都有明显的正相关。有报道称，断奶体重多 1kg，出栏时间可以缩短大约10d，饲料效率提高 \n3%~5%，因此，相同日龄仔猪的断奶体重越大越好。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; white-space: pre-wrap; line-height: 25.6px; widows: 1; \">　　</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; white-space: pre-wrap; line-height: 25.6px; widows: 1; \">笔者近日去河南禹州某客户猪场回访，该场产房仔猪的断奶重让我眼前一亮。在全国走过太多的猪场，仔猪25天平均断奶重能够达到8kg就已经不错了。而该场平均每窝12头仔猪，26天平均断奶重高达9.5公斤，母猪平均日采食量超过8kg。见图。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; white-space: pre-wrap; line-height: 25.6px; widows: 1; \"><br style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; \"/></p><center style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; line-height: 25.6px; widows: 1; \"><img data-s=\"300,640\" data-type=\"jpeg\" data-src=\"http://mmbiz.qpic.cn/mmbiz/v9b4XniaEv6ZFyaXvsEAiaIibSU7mBJaz6EaJzvFXBjF0Eic3F4wtr8JDiafXj7hZ6av3tURqZO4dDCkbkuwba03uYg/0?wx_fmt=jpeg\" data-ratio=\"0.75\" data-w=\"\" src=\"http://mmbiz.qpic.cn/mmbiz/v9b4XniaEv6ZFyaXvsEAiaIibSU7mBJaz6EaJzvFXBjF0Eic3F4wtr8JDiafXj7hZ6av3tURqZO4dDCkbkuwba03uYg/640?wx_fmt=jpeg&wxfrom=5&wx_lazy=1\" style=\"margin: 0px; padding: 0px; height: auto !important; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; width: auto !important; visibility: visible !important; \"/><br style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; \"/></center><center style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; line-height: 25.6px; widows: 1; \"><br style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; \"/></center><center style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; line-height: 25.6px; widows: 1; \"></center><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; white-space: pre-wrap; line-height: 25.6px; widows: 1; \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; line-height: 1.6; \">在惊讶于该场实际生产水平的同时，笔者在想，按照能量守恒定律，母猪平均每天采食多少饲料才能让仔猪25天断奶重达到过9kg。因此，笔者计算了一下，仅供大家参考。</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; white-space: pre-wrap; line-height: 25.6px; widows: 1; \">　　</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; white-space: pre-wrap; line-height: 25.6px; widows: 1; \">每窝12头断奶仔猪，25天每头断奶重9kg的生产性能。以初生仔猪体重1.5kg计算，哺乳期仔猪总增重为：12×(9 - 1.5)= 90kg。这些增重的营养来源有乳汁(饲料转化及体重消耗)和教槽料。按照每头采食600g质量优良的教槽料，可以带来大约600g/头的体重增加;剩下的82.8kg \n增重(90– 12×0.6 = 82.8)，则全部来源于母乳(所以说母乳是仔猪最重要的营养来源)。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; white-space: pre-wrap; line-height: 25.6px; widows: 1; \">　<span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; line-height: 1.6; \">　</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; white-space: pre-wrap; line-height: 25.6px; widows: 1; \">研究表明，每千克母乳大约含200g干物质(55g粗蛋白，50g乳糖，80g脂肪，5.4MJ/Kg \nME)。仔猪每增重1kg大约需要22MJ的ME，母乳中蛋白的氨基酸组成十分平衡，那么仔猪每增重1kg大约需要4kg母乳(22/5.4=4)。共需要331.2kg母乳(82.8×4=331.2)。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; white-space: pre-wrap; line-height: 25.6px; widows: 1; \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; line-height: 25.6px; \">　　</span><br style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; \"/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; white-space: pre-wrap; line-height: 25.6px; widows: 1; \">一头200kg重的母猪，哺乳期体重消耗10%，即20kg。按照每消耗1kg体重产乳2kg，可产乳40kg。剩下291.2kg母乳(331.2 – 40 \n= 291.2)，则全部来源母猪采食的饲料。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; white-space: pre-wrap; line-height: 25.6px; widows: 1; \">　　</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; white-space: pre-wrap; line-height: 25.6px; widows: 1; \">哺乳母猪的典型日粮是谷物和植物蛋白组成，每千克约含14MJ的ME。饲料能量转化为乳能量的效率大约为70%，这意味着母猪每摄入1kg饲料就能生产相当于9.8MJME的乳。即母猪除了用于维持需要外，每消耗1kg饲料就能产生大约1.8kg的乳(9.8/5.4=1.8)。共需要饲料大约为162kg(291.2/1.8 =162)，平均每天需要6.48kg(162/25=6.48)饲料用来泌乳。母猪每天的维持需要量大约为母猪体重的1%，一头200kg重的母猪，每天大概需要2kg饲料用于维持。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; white-space: pre-wrap; line-height: 25.6px; widows: 1; \">　　</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; white-space: pre-wrap; line-height: 25.6px; widows: 1; \">综上所述，一头200kg重的母猪，带12头仔猪，要达到25天平均断奶重9kg的生产水平，母猪哺乳期掉膘20kg以内，每头仔猪采食600g教槽料，则母猪的平均日采食量需要达到8.48kg(2+ 6.48 =8.48)。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; white-space: pre-wrap; line-height: 25.6px; widows: 1; \">　　</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; white-space: pre-wrap; line-height: 25.6px; widows: 1; \">因此，请采取一切措施尽可能提高母猪哺乳期的采食量，让母猪平均日采食量达到8kg以上，以达到您期望的仔猪断奶重。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; white-space: pre-wrap; line-height: 25.6px; widows: 1; \"><br style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; \"/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; white-space: pre-wrap; line-height: 25.6px; widows: 1; \">来源：<span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; \">（</span>PSY应用研究院）</p><p><br/></p>','','0','0','1456384794'),
('29','63','0','【养猪必读】春季到了，一大波猪病又将到来，赶紧拉起警报','','春天万物复苏，对于猪、细菌、病毒都是一样的，在猪快速生长的同时也要注意预防一些疾病的发生。','images/3/2016/02/uiI6s5hh3HHG9F5oIFiUg3ZzG3a56s.jpg','<h2 id=\"activity-name\" class=\"rich_media_title\">【养猪必读】春季到了，一大波猪病又将到来，赶紧拉起警报</h2><p>上周流行性腹泻爆发较多，很多猪场都受此病的威胁，损失惨重。除了腹泻，猪的呼吸道疾病也比较厉害，春季昼夜温差大，通风做的不好是导致呼吸道疾病的主要原因之一。提醒广大猪友，在治疗猪呼吸道时，一定要做好舍内通风换气工作。<br/></p><p><br/></p><p>　　春天万物复苏，对于猪、细菌、病毒都是一样的，在猪快速生长的同时也要注意预防一些疾病的发生。</p><p><br/></p><p>　　<strong><span style=\"color: rgb(255, 0, 0);\">一、猪瘟</span></strong></p><p><br/></p><p>　　猪瘟是猪场一年四季都重点预防的疾病。但是在春季有好多外购仔猪，猪场为了节约成本，就不做猪瘟疫苗，或者是做了猪瘟疫苗就出售，经过长途运输的应激，疫苗也没有起到作用。所以养育肥猪的人，一定要在抓猪回一周无异常时补打猪瘟疫苗。对于全进全出的猪场，一定要严格按照猪场免疫程序进行免疫，也可以定期检测猪瘟抗体来调整免疫程序，确保猪场安全。</p><p><br/></p><p>　<span style=\"color: rgb(255, 0, 0);\">　<strong>二、流行性腹泻</strong></span></p><p><br/></p><p>　　流行性腹泻是1-5日龄仔猪杀手，以迅速传播、水样腹泻、快速脱水死亡为特点。给养猪业带来严重的损失，并且到现在为止对于仔猪还没有好的治疗方法。广大猪友只能提高母猪的抵抗力，来保护仔猪。猪病通执业兽医师建议：在母猪产前40天和20天各注射胃流二联疫苗1次。如果此方法无效，就采取病死仔猪肠道做自家苗给母猪预防(慎用)。</p><p><br/></p><p>　<span style=\"color: rgb(255, 0, 0);\">　<strong>三、副猪嗜血杆菌病</strong></span></p><p><br/></p><p>　　此病寒冷季节多发，春季预防主要是因为，进入春季天气变暖猪场保育舍停止供暖，如果温度调控的不好，就会导致昼夜温差过大，引发本病。猪病通执业兽医师建议，春季停止供暖要循序渐进，平稳过度。预防：仔猪上保育每吨饲料添加阿莫西林10%和恩诺沙星10%各1公斤使用7天。</p><p><br/></p><p>　　<strong><span style=\"color: rgb(255, 0, 0);\">四、大肠杆菌病</span></strong></p><p><br/></p><p><strong>　　1.仔猪黄白痢</strong></p><p><br/></p><p>　　主要发生在哺乳期仔猪，原因是母猪奶水不足或者奶质不好。猪病通执业兽医师建议预防黄白痢要保证产房温暖干燥、没有贼风，母猪产后用过奶止痢散或者强力霉素做保健。</p><p><br/></p><p>　<strong>　2.猪水肿病</strong></p><p><br/></p><p>　　主要发生在生长速度快的保育猪身上，没有征兆，急性死亡防不胜防。主要症状表现在眼睑、头部、颈部和肛门等部位水肿。一经发现此病，用呋塞米和卡那霉素注射全圈小猪，降低饲喂量和饲料里的蛋白质水平，并在饲料里添加亚硒酸钠VE。</p><p><br/></p><p>　　春季在做好饲养管理、免疫接种，通风和保温工作的同时，还应做好猪病的防控工作。</p><p><br/></p><p>　　来源：养猪网</p><p><br/></p>','','0','1','1456402795'),
('30','63','29','妈妈与儿子的《寻人启事》，刺痛无数家长的心！','','真正的爱，是不应该附加任何条件的。我想起了心理学家罗杰斯的名言：“爱是深深的理解和接受。”孩子无条件地接受了我们，我们为什么就不能接受孩子呢？为什么一定要苛求他们十全十美呢？','images/3/2016/02/DBQqF18626W28S5SSsEBXw26Nz22N2.jpg','<script></script><h2 class=\"rich_media_title\">妈妈与儿子的《寻人启事》，刺痛无数家长的心！</h2><p><strong class=\"profile_nickname\">逻辑一思维</strong></p><p><span id=\"js_profile_arrow_wrp\" class=\"profile_arrow_wrp\"><em class=\"profile_arrow arrow_out\"></em><em class=\"profile_arrow arrow_in\"></em></span></p><p><span style=\"line-height: 1.6;\"></span></p><p><br/></p><p></p><section><section><section><section><section><section><section><section><span style=\"line-height: 1.6; background-color: rgb(254, 255, 255);\">看到儿子拿回来的勉强及格的试卷，我失望透了。儿子都11岁了，还一点儿都不懂事，一点儿也不听话，一点儿也不争气，各方面都不如同龄人。</span><span style=\"line-height: 1.6; box-sizing: border-box; background-color: rgb(254, 255, 255);\">失望之余，我写了一篇《寻人启事》来发泄心中的怒火。当晚，我把这个《寻人启事》贴在了儿子房间的门上，然后去睡觉了。我想，第二天早上儿子起床后应该看得到。真希望他能知耻而后勇，向着我心目中理想的儿子前进。哪怕只是接近一点儿，我也会很欣慰的。</span><br/></section></section></section></section></section></section></section><section style=\"box-sizing: border-box;\" class=\"Powered-by-XIUMI V5\"><section style=\"margin-top: 10px; margin-bottom: 10px; box-sizing: border-box;\"><section style=\"padding: 10px; border: 1px solid rgb(192, 200, 209); width: 100%; display: inline-block; box-sizing: border-box; background-color: rgb(239, 239, 239);\"><section style=\"box-sizing: border-box;\" class=\"Powered-by-XIUMI V5\"><section style=\"box-sizing: border-box;\"><section style=\"box-sizing: border-box;\"><section style=\"text-align: center; box-sizing: border-box;\"><span style=\"font-size: 20px;\"><strong style=\"box-sizing: border-box;\">寻人启事</strong></span></section><section style=\"text-align: center; box-sizing: border-box;\"><img style=\"width: auto !important; height: auto !important; line-height: 25.6px; white-space: normal; visibility: visible !important; word-wrap: break-word !important; box-sizing: border-box !important; \" src=\"http://mmbiz.qpic.cn/mmbiz/PfFCibB8LibtkUvbXKC6ic84ibicVjOxPGSicbDUoMDeuNs4MnVmVPWgZf3fKMj7FR2E5B3Ux4U0vJa81oD0mT9fbZnA/640?wx_fmt=jpeg&wxfrom=5&wx_lazy=1\" width=\"auto\" data-type=\"jpeg\" data-src=\"http://mmbiz.qpic.cn/mmbiz/PfFCibB8LibtkUvbXKC6ic84ibicVjOxPGSicbDUoMDeuNs4MnVmVPWgZf3fKMj7FR2E5B3Ux4U0vJa81oD0mT9fbZnA/640?wx_fmt=jpeg\" data-w=\"242\" data-ratio=\"0.8512396694214877\" data-s=\"300,640\"/></section><section style=\"box-sizing: border-box;\">我有一个好孩子，可是后来丢失了。现在特登报寻找。 他今年11岁，很聪明，但不骄傲。他热爱学习，做作业非常认真，每次考试都是全班前三名。他很听话，从来不用父母操心。吃饭不挑食，身体健康，很少生病。他热爱劳动，积极做家务。不玩游戏，也很少看电视。他性格开朗、活泼大方，在亲戚和长辈面前表现得彬彬有礼。他有很多品德优良、成绩优秀的朋友。在父母有烦心事时，他不会去打扰，而是很懂事地来安慰父母。他知道父母挣钱不容易，从不乱花钱。他做的每一件事都非常得体，让父母感到骄傲。可是，谁能告诉我，他在哪里呢？</section><section style=\"box-sizing: border-box;\"><br style=\"box-sizing: border-box;\"/></section></section></section></section></section></section></section><section style=\"box-sizing: border-box;\" class=\"Powered-by-XIUMI V5\"><section style=\"margin-top: 10px; margin-bottom: 10px; box-sizing: border-box;\"><section style=\"padding: 10px; border: 1px solid rgb(255, 255, 255); width: 100%; display: inline-block; box-sizing: border-box; background-color: rgb(254, 255, 255);\"><section style=\"box-sizing: border-box;\" class=\"Powered-by-XIUMI V5\"><section style=\"box-sizing: border-box;\"><section style=\"box-sizing: border-box;\"><section style=\"box-sizing: border-box;\"><span style=\"line-height: 1.6; box-sizing: border-box;\">第二天早上，我发现儿子门上的《寻人启事》已经没有了。当我走回自己的房间时，惊讶地发现门上也贴了一张寻人启事。揭下来仔细一看，我愣住了。</span><span style=\"line-height: 1.6; box-sizing: border-box;\">儿子写的《寻人启事》，全文如下：</span></section></section></section></section></section></section></section><section style=\"box-sizing: border-box;\" class=\"Powered-by-XIUMI V5\"><section style=\"margin-top: 10px; margin-bottom: 10px; box-sizing: border-box;\"><section style=\"padding: 10px; border: 1px solid rgb(192, 200, 209); width: 100%; display: inline-block; box-sizing: border-box; background-color: rgb(239, 239, 239);\"><section style=\"box-sizing: border-box;\" class=\"Powered-by-XIUMI V5\"><section style=\"box-sizing: border-box;\"><section style=\"box-sizing: border-box;\"><section style=\"text-align: center; box-sizing: border-box;\"><span style=\"font-size: 20px;\"><strong style=\"box-sizing: border-box;\">寻人启事</strong></span></section><section style=\"text-align: center; box-sizing: border-box;\"><img style=\"width: auto !important; height: auto !important; line-height: 25.6px; white-space: normal; visibility: visible !important; word-wrap: break-word !important; box-sizing: border-box !important; \" src=\"http://mmbiz.qpic.cn/mmbiz/PfFCibB8LibtkUvbXKC6ic84ibicVjOxPGSicbtsXpsEe5d2K5oJxq6icRRA35xQ0IBf2QleoznI1icYaBCUvzZicZ8rYbQ/640?wx_fmt=jpeg&wxfrom=5&wx_lazy=1\" width=\"auto\" data-type=\"jpeg\" data-src=\"http://mmbiz.qpic.cn/mmbiz/PfFCibB8LibtkUvbXKC6ic84ibicVjOxPGSicbtsXpsEe5d2K5oJxq6icRRA35xQ0IBf2QleoznI1icYaBCUvzZicZ8rYbQ/640?wx_fmt=jpeg\" data-w=\"234\" data-ratio=\"1.3162393162393162\" data-s=\"300,640\"/></section><section style=\"box-sizing: border-box;\"><br style=\"box-sizing: border-box;\"/></section><section style=\"box-sizing: border-box;\">我有一个好妈妈，可是后来不见了。现在特登报寻找。 妈妈很普通，她没有电影明星那样光彩照人，也没有市长那样大的权力，更不像世界首富那样有钱，但她很爱我。在我什么都不会，只会发出恼人的哭声时，她从不嫌弃我。她每天都慈爱地陪伴我。在深夜里，虽然她很困了，甚至睡着了，但只要我发出一声哭叫，她就会立刻满怀关切地抱住我，紧张地查看我哪里出了问题，然后再哄我睡觉。她花了好多时间教我这个小笨蛋说话和走路，虽然我学了很久，才含混不清地说出了“妈妈”这个词，但妈妈从来不说我笨，相反，她还兴高采烈地亲我，夸我聪明，让我大受鼓舞。</section><section style=\"box-sizing: border-box;\">后来我上学了，虽然学习成绩不是很好，但她依然很爱我。她说，早开的花不一定会早结果，早结果的不一定结的果就大。妈妈从来不因我的成绩而嘲笑我，她知道，越是成绩不好，越需要关心和鼓励。她还说，相比成绩而言，我的健康和快乐更重要。虽然我总是犯错，总是因为成绩不好让妈妈丢脸，但她依然很爱我，因为我是她的孩子。我也很爱妈妈，不是因为她是优秀工作者，而是因为她是我妈妈。</section></section></section></section></section></section></section><section style=\"box-sizing: border-box;\" class=\"Powered-by-XIUMI V5\"><section style=\"margin-top: 10px; margin-bottom: 10px; box-sizing: border-box;\"><section style=\"padding: 10px; border: 1px solid rgb(255, 255, 255); width: 100%; display: inline-block; box-sizing: border-box; background-color: rgb(254, 255, 255);\"><section style=\"box-sizing: border-box;\" class=\"Powered-by-XIUMI V5\"><section style=\"box-sizing: border-box;\"><section style=\"box-sizing: border-box;\"><section style=\"box-sizing: border-box;\">看完儿子写的启事，我泪流满面。相比儿子，我觉得自己太狭隘了。<strong>我们做父母的常常会因为孩子不够优秀而抱怨他们，但孩子们却不会因为我们不够有钱，不够有权，不够漂亮而抱怨我们。</strong>我们对孩子的爱没有孩子对我们的爱纯净和纯粹。在这一点上，我们愧对孩子。</section><section style=\"box-sizing: border-box;\"><br style=\"box-sizing: border-box;\"/></section><section style=\"box-sizing: border-box;\">真正的爱，是不应该附加任何条件的。我想起了心理学家罗杰斯的名言：“<strong>爱是深深的理解和接受。”孩子无条件地接受了我们，我们为什么就不能接受孩子呢？为什么一定要苛求他们十全十美呢？</strong>我擦干泪，再次来到儿子的门前，敲响了门，要向儿子道歉。不是孩子不优秀，只是家长太落后！</section></section></section></section></section></section></section></section><p></p><p><br/></p><script></script><p><br/></p>','','0','1','1456402795'),
('28','62','26','一个铜钱的故事，真正看懂的人，都成功了','','每个人都梦想成功，而且财富就在我们身边。有的人抱怨财运不佳，有的人埋怨社会不公，有的人感慨父母无能……其实我们真正缺乏的正是勤奋和发现财富的慧眼。','images/3/2016/02/Z07BaR2Cn0h7RRHAba7GqWGLhWwNN0.jpg','<script></script><h2 class=\"rich_media_title\">一个铜钱的故事，真正看懂的人，都成功了</h2><p><strong class=\"profile_nickname\">逻辑一思维</strong></p><p><span id=\"js_profile_arrow_wrp\" class=\"profile_arrow_wrp\"><em class=\"profile_arrow arrow_out\"></em><em class=\"profile_arrow arrow_in\"></em></span></p><p><span style=\"line-height: 25.6px; word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;\">有位年轻人，抓了一只老鼠，卖给药铺，他得到了1枚铜币。他走过花园，听花匠们说口渴，他又有了想法。他用这枚铜币买了一点糖浆，和着水送给花匠们喝。花匠们喝了水，便一人送他一束花。他到集市卖掉这些花，得到了8个铜币。</span></p><p><br style=\"word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;\"/></p><p>一个风雨交加的日子，果园里到处都是被狂风吹落的枯枝败叶。年轻人对园丁说：“如果这些断枝落叶送给我，我愿意把果园打扫干净。”园丁很高兴：“可以，你都拿去吧！”年轻人用8个铜币买了一些糖果，分给一群玩耍的小孩，小孩们帮他把所有的残枝败叶捡拾一空。年轻人又去找皇家厨工说有一堆柴想卖给他们，厨工付了16个铜币买走了这堆柴火。</p><p><br style=\"word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;\"/></p><p>年轻人用16个铜币谋起了生计，他在离城不远的地方摆了个茶水摊，因为附近有500个割草工人要喝水。不久，他认识了一个路过喝水的商人，商人告诉他：“明天有个马贩子带400匹马进城。”听了商人的话，年轻人想了一会，对割草工人说：“今天我不收钱了，请你们每人给我一捆草，行吗？”工人们很慷慨地说：“行啊！”这样，年轻人有了500捆草。第二天，马贩子来了要买饲料，便出了1000个铜币买下了年轻人的500捆草。</p><p><br style=\"word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;\"/></p><p>几年后，年轻人成了远近闻名的大财主。</p><p><br/></p><p><span style=\"word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important; \"><strong style=\"word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;\"> &nbsp; 年轻人的成功不是偶然的，因为他具备了现代人的管理素质。</strong></span></p><p><br style=\"word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;\"/></p><p><strong style=\"word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;\"> &nbsp; 1、他很有思想：</strong>他明白要想得到就一定要付出。他先送水给花匠喝，花匠得到了好处，便给了他回报。这也是双赢的智慧。</p><p><br style=\"word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;\"/></p><p><strong style=\"word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;\"> &nbsp; 2、他很有眼光：</strong>他知道那些断枝落叶可以卖个好价钱，但如何得到大有学问。所以，他提出以劳动换取。这也符合勤劳制富的社会准则。</p><p><br style=\"word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;\"/></p><p><strong style=\"word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;\"> &nbsp; 3、他很有组织能力：</strong>他知道，单靠他一个人难以完成这项工作。他组织了一帮小孩为他工作，并用糖果来支付报酬。从这一点看，他具备领导艺术和管理才能，他用较低的成本赢得了较大的投资收益。</p><p><br style=\"word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;\"/></p><p><span style=\"word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important; \"><strong style=\"word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;\"> &nbsp;4、他很有信息意识：</strong></span>他可以从和商人的谈话中捕捉赚钱的机会，再用较低的价格收购了一大批草转手卖了个好价钱。这一点，与我们今天在信息时代的经济贸易非常吻合。</p><p><br style=\"word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;\"/></p><p><strong> 每个人都梦想成功，而且财富就在我们身边。有的人抱怨财运不佳，有的人埋怨社会不公，有的人感慨父母无能……其实我们真正缺乏的正是勤奋和发现财富的慧眼。</strong></p><script></script><p><br/></p>','','0','1','1456384794'),
